import React from 'react';
import { Layout, Menu, Divider, Button } from 'antd';
import {
  HomeOutlined,
  AppstoreOutlined,
  QuestionCircleOutlined,
  UserOutlined,
  SettingOutlined,
  LoginOutlined,
} from '@ant-design/icons';
import './Sidebar.css';

const { Sider } = Layout;

const Sidebar = () => {
  const menuItems = [
    {
      key: 'home',
      icon: <HomeOutlined />,
      label: '首页',
    },
    {
      key: 'services',
      icon: <AppstoreOutlined />,
      label: '业务办理',
    },
    {
      key: 'faq',
      icon: <QuestionCircleOutlined />,
      label: '百问百答',
    },
  ];

  return (
    <Sider width={180} className="sidebar">
      <div className="logo">
        <img 
          src="/logo.png" 
          alt="北美生活" 
          className="company-logo" 
        />
      </div>
      <Divider style={{ margin: '0 0 16px 0' }} />
      <Menu
        mode="vertical"
        items={menuItems}
        defaultSelectedKeys={['home']}
        className="sidebar-menu"
      />
      <div className="bottom-menu">
        <Button type="text" icon={<LoginOutlined />} className="bottom-menu-item">
          登录
        </Button>
        <Button type="text" icon={<UserOutlined />} className="bottom-menu-item">
          账号
        </Button>
        <Button type="text" icon={<SettingOutlined />} className="bottom-menu-item">
          设置
        </Button>
      </div>
      <Divider style={{ margin: '16px 0' }} />
      <div className="company-info">
        <p>© 2024 北美生活</p>
        <p>专业美国公司注册服务</p>
      </div>
    </Sider>
  );
};

export default Sidebar;
